import React from "react";

interface IconTextFieldProps {
    label?: string;
    id?: string;
    placeholder?: string;
    onChange?: (value: string) => void;
    icon: JSX.Element
}

const IconTextField: React.FC<IconTextFieldProps> = ({id, label, placeholder, onChange, icon}) => {
    return <>
        {
            label && (
                <label className="block mb-2 text-sm font-medium text-gray-900">
                    { label }
                </label>
            )
        }

        <div className="relative">
            <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
                { icon }
            </div>
            <input
                id={ id }
                className="block w-full py-1.5 pl-10 text-sm text-gray-900 border border-gray-300 rounded-lg bg-gray-50 focus:ring-orange-500 focus:border-orange-500 "
                placeholder={placeholder}
                onChange={(event) => onChange ? onChange(event.target.value) : undefined}
            />
        </div>
    </>
}

export default IconTextField;
